window.bookSummaryJSON = "<p>After Axel's house collapses on him during a hurricane, I'm desperate to reclaim my lost mate. Only with the help of the triplets, my own band of outlaw lovers, am I able to reconcile with the thought of losing him.</p> <p>Just as we think all is lost, Axel begins to recover. With the help of my love and the newly incorporated members of my group, the Jacksonville pack begins to rebuild after the devastating hurricane.</p> <p>But more threats lie ahead.</p> <p>When more of the giant mutant wolves who attacked me in the woods begin to appear on pack land, we must band together not only with each other to form our own little family of five, but with the most unlikely allies of all.</p> <p>Only with every hand on deck do we have a chance at defeating the monsters and finally getting the happily ever after we've worked so hard to achieve.</p> <p><b>This is book three in a trilogy and cannot be enjoyed on its own. Not intended for listeners under 18.</b></p>"; 
